import React, {Component} from 'react';
import './style2.css';
import {Col, Row} from 'react-bootstrap';
import { Link } from "react-router-dom";

class CustomButton extends Component{
    constructor(props){
        super(props)
        this.state={
            isLoading: false
        };
    }
}

const Button =({downloadTest, value})=>{
    return(
        <Button className={ 'button is-primary' + (this.state.isLoading ? 'is-loading' : '')} onClick={downloadTest} value={value}/>
    );
}

export default Button;
